import { Component } from '@angular/core';

@Component({
  selector: 'app-card-anotacao',
  templateUrl: './card-anotacao.component.html',
  styleUrls: ['./card-anotacao.component.css']
})
export class CardAnotacaoComponent {

}
<div class="card card-home">
    <div class="card-header">
        <span class="nm-autor">Lucas Teixeira</span>
        <span class="titulo-anotacao">Anotação sobre python</span>
    </div>

    <div class="card-content">
        <p class="content-text">
            Python é uma linguagem de programação multiplataforma que permite desenvolver aplicações para games, desktops, web e dispositivos móveis. Além disso, ela pode se comunicar com outras aplicações que foram desenvolvidas em outras linguagens como C, C++, Java e C#.
        </p>
    </div>
</div>
